function ImageCard(props) {
  return (
    <div className="flex-row h-80 space-y-4 bg-white border-2 border-white  rounded-xl shadow my-5 overflow-hidden transition-transform duration-300
                    custom-scale hover:cursor-pointer hover:border-green-700 hover:border-4">
      <img className="w-full h-full object-cover  object-[50%_25%] rounded-md" src={props.url} alt="img" />
      <h3 className="text-left text-2xl mx-3">{props.title}</h3>

      <p className="text-justify mx-3">{props.description}</p>
      <audio className="px-2 my-2 w-full" controls></audio>
    </div>
  );
}
export default ImageCard;
